export function loadLevel2(scene) {
    let platforms = scene.physics.add.staticGroup()
    let objects = scene.physics.add.staticGroup()
    
    // Static platforms - different layout from level 1
    platforms.create(400, 698, "ground")
    platforms.create(200, 500, "island")
    platforms.create(600, 400, "island")
    platforms.create(300, 300, "island")
    
    // Dynamic platforms
    let dynamicPlatforms = [];
    
    // Bouncing platform that goes up and down
    let platform1 = scene.physics.add.sprite(100, 350, "island").setImmovable(true);
    platform1.body.setAllowGravity(false);
    platform1.bouncingPlatform = true;
    platform1.bounceSpeed = 120;
    platform1.minY = 250;
    platform1.maxY = 450;
    platform1.setVelocityY(platform1.bounceSpeed);
    dynamicPlatforms.push(platform1);
    
    // Trapped platform - falls when touched
    let platform2 = scene.physics.add.sprite(500, 200, "island").setImmovable(true);
    platform2.body.setAllowGravity(false);
    platform2.trappedPlatform = true;
    platform2.triggered = false;
    dynamicPlatforms.push(platform2);
    
    // Floor hole trap
    let platform3 = scene.physics.add.sprite(200, 500, "island").setImmovable(true);
    platform3.body.setAllowGravity(false);
    platform3.openHole = true;
    platform3.holeActive = false;
    dynamicPlatforms.push(platform3);
    
    // Moving platform that changes direction unexpectedly
    let platform4 = scene.physics.add.sprite(700, 250, "island").setImmovable(true);
    platform4.body.setAllowGravity(false);
    platform4.trickPlatform = true;
    platform4.changeTimer = 0;
    platform4.setVelocityX(80);
    platform4.minX = 550;
    platform4.maxX = 750;
    dynamicPlatforms.push(platform4);
    
    // Teleporters
    let teleporter1 = scene.physics.add.sprite(200, 480, "star").setScale(2);
    teleporter1.body.setAllowGravity(false);
    teleporter1.setTint(0x00ffff);
    teleporter1.isTeleporter = true;
    teleporter1.targetX = 600;
    teleporter1.targetY = 380;
    dynamicPlatforms.push(teleporter1);
    
    let teleporter2 = scene.physics.add.sprite(600, 380, "star").setScale(2);
    teleporter2.body.setAllowGravity(false);
    teleporter2.setTint(0x00ffff);
    teleporter2.isTeleporter = true;
    teleporter2.targetX = 200;
    teleporter2.targetY = 480;
    dynamicPlatforms.push(teleporter2);
    
    let portal = scene.physics.add.sprite(500, 150, "portal").setScale(2);
    portal.body.setAllowGravity(false);
    
    return { 
        platforms, 
        portal,
        dynamicPlatforms
    };
}

export function updateLevel2(scene, player, dynamicPlatforms) {
    if (!dynamicPlatforms || dynamicPlatforms.length === 0) return;
    
    dynamicPlatforms.forEach(platform => {
        // Teleporters
        if (platform.isTeleporter) {
            // Make them pulse
            platform.setAlpha(0.5 + Math.sin(scene.time.now / 200) * 0.5);
            
            if (scene.physics.overlap(player, platform)) {
                if (!platform.teleporting) {
                    platform.teleporting = true;
                    player.setPosition(platform.targetX, platform.targetY);
                    player.setVelocity(0, 0);
                    // Reset teleport cooldown
                    scene.time.delayedCall(500, () => {
                        platform.teleporting = false;
                    });
                }
            }
        }
        
        // Bouncing platform
        if (platform.bouncingPlatform) {
            if (platform.y >= platform.maxY && platform.body.velocity.y > 0) {
                platform.setVelocityY(-platform.bounceSpeed);
            } else if (platform.y <= platform.minY && platform.body.velocity.y < 0) {
                platform.setVelocityY(platform.bounceSpeed);
            }
        }
        
        // Trapped platform
        if (platform.trappedPlatform && !platform.triggered) {
            if (scene.physics.world.collide(player, platform)) {
                platform.triggered = true;
                platform.setTint(0xff6600);
                scene.time.delayedCall(400, () => {
                    platform.setImmovable(false);
                    platform.body.setAllowGravity(true);
                    platform.setTint(0xff0000);
                });
            }
        }
        
        // Opening hole
        if (platform.openHole) {
            const distance = Math.abs(player.x - platform.x);
            if (distance < 70 && !platform.holeActive) {
                platform.holeActive = true;
                platform.body.checkCollision.none = true;
                platform.setAlpha(0);
                scene.time.delayedCall(2500, () => {
                    platform.holeActive = false;
                    platform.body.checkCollision.none = false;
                    platform.setAlpha(1);
                });
            }
        }
        
        // Trick platform - randomly changes speed/direction
        if (platform.trickPlatform) {
            platform.changeTimer++;
            if (platform.changeTimer > 120) {
                platform.setVelocityX(platform.body.velocity.x * (Math.random() > 0.5 ? 1.5 : -1));
                platform.changeTimer = 0;
            }
            if (platform.x >= platform.maxX && platform.body.velocity.x > 0) {
                platform.setVelocityX(-Math.abs(platform.body.velocity.x));
            } else if (platform.x <= platform.minX && platform.body.velocity.x < 0) {
                platform.setVelocityX(Math.abs(platform.body.velocity.x));
            }
        }
    });
}
